import {CHANGE_SEARCHFIELD,
		REQUEST_ROBOTS_PENDING,
		REQUEST_ROBOTS_SUCCESS,
		REQUEST_ROBOTS_FAILED} from './constants';


const setSetSearchfield = (text) =>{
	return(
		{type: CHANGE_SEARCHFIELD,
	     payload: text})}

export {setSetSearchfield};
